INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1001, 1, "春咲 ひより", 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1, 0, 0, "お！\nあそこに困ってそうな人発見！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1002, 1, "草野 優衣", 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1, 0, 0, "大切な人を\n守れるようになりたい…って", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1003, 1, "士条 怜", 2, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 0, 0, 1, 0, 0, "キミに必要な集中力と感性が", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1004, 1, "穂高 みそぎ", 2, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 0, 0, 1, 0, 0, "今日はなにして遊ぶ？", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1006, 1, "風宮 あかり", 2, "私といっしょに…\nいかない？", "風宮あかりです", 0, 0, 1, 0, 0, "ねぇ…", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1007, 1, "出雲 宮子", 2, "食べ物の恨みは怖いのー", "出雲宮子なのー", 0, 0, 1, 0, 0, "プリンたべたいのー", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1008, 1, "虹村 雪", 2, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 0, 0, 1, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1009, 1, "柊杏奈", 2, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 0, 0, 1, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1010, 1, "姫宮 真歩", 2, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1011, 1, "衣之咲 璃乃", 2, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 0, 0, 1, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1012, 1, "柏崎 初音", 2, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1, 0, 0, "ち、超能力って…\n何のことかな～？", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1016, 1, "美波 鈴奈", 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1, 0, 0, "一応カリスマ読モJKやってまっす！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1017, 1, "喜屋武 香織", 2, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 0, 0, 1, 0, 0, "東京は遊園地みたいなところさー", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1018, 1, "支倉 伊緒", 2, "イオちゃんって呼んでね。", "支倉伊緒です。", 0, 0, 1, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1020, 1, "茜 ミミ", 2, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1021, 1, "栗林 くるみ", 2, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1, 0, 0, "あの……\nふぇ……", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1022, 1, "風宮 より", 2, "なんてありがとうございます！", "風宮よりです。\nあああああ！", 0, 0, 1, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1023, 1, "北条 綾音", 2, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1, 0, 0, "おにいちゃんどこいくの？\nえ？", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1025, 1, "天野 すずめ", 2, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1027, 1, "倉石 恵理子", 2, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 0, 0, 1, 0, 0, "あなたは…運命の……\n伴侶……", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1028, 1, "佐々木 咲恋", 2, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1029, 1, "桜井 望", 2, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 0, 0, 1, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1030, 1, "ニノン・ジュベール", 2, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 0, 0, 1, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1031, 1, "上喜 しのぶ", 2, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1033, 1, "野戸まひる", 2, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1, 0, 0, "けんども\nそれには足りないモンが…", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1034, 1, "綾瀬 ゆかり", 2, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1, 0, 0, "ちょっと緊張しちゃって…", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1036, 1, "氷川 鏡華", 2, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 0, 0, 1, 0, 0, "知らない人とは話しちゃいけないので", 1.5, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1038, 1, "柏崎 栞", 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 0, 0, 1, 0, 0, "……あ、アラーム。", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1040, 1, "双葉 碧", 2, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 0, 0, 1, 0, 0, "私、一人も友達がいなくて……", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1042, 1, "三角 千歌", 2, "そう思っています。", "三角千歌です。", 0, 0, 1, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1043, 1, "安芸 真琴", 2, "う、疑ってすまなかったな…", "安芸真琴だ。", 0, 0, 1, 0, 0, "あぁ？\nお前のそいつの仲間か？", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1044, 1, "イリヤ・オーンスタイン", 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 0, 0, 1, 0, 0, "生けとし生ける全ての者よ！", 1.4, 1);
