INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1046, 1, "宮坂たまき", 2, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1.4, 1);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (0, 1048, 1, "大神 美冬", 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 0, 0, 1, 0, 0, "それでは早速クエストに…", 1.4, 1);
